# ==========================================
# 1. CORE LOGIC (Shared between both UIs)
# ==========================================
class AeroBridgeCore:
    def safe_log(self, msg):
        self.root.after(0, self._insert_log, msg)

    def _insert_log(self, msg):
        self.log_box.config(state="normal")
        self.log_box.insert("end", f"[{datetime.now().strftime('%H:%M:%S')}] {msg}\n")
        self.log_box.see("end")
        self.log_box.config(state="disabled")

    def run_command(self, cmd):
        try:
            cf = 0x08000000 if os.name == 'nt' else 0
            return subprocess.run(cmd, capture_output=True, text=True, creationflags=cf)
        except Exception as e:
            self.safe_log(f"System Error: {e}")
            return None

    def run_custom_command(self, event=None):
        cmd_text = self.cmd_var.get().strip()
        if not cmd_text: return
        self.cmd_var.set("") 
        
        try: args = shlex.split(cmd_text)
        except ValueError: args = cmd_text.split()
            
        def task():
            self.root.after(0, self.progress.start, 10)
            self.safe_log(f"> {cmd_text}")
            res = self.run_command(args)
            self.root.after(0, self.progress.stop)
            
            if res is not None:
                if res.stdout.strip(): self.safe_log(res.stdout.strip())
                if res.stderr.strip(): self.safe_log(f"Error:\n{res.stderr.strip()}")
                if res.returncode == 0: self.safe_log("Command Finished.")
                else: self.safe_log(f"Exited with code {res.returncode}.")
            else:
                self.safe_log("Failed to launch command. Check spelling or path.")
        threading.Thread(target=task, daemon=True).start()

    def run_adb_background(self, args, success_msg="Command Success"):
        def task():
            self.root.after(0, self.progress.start, 10)
            self.safe_log(f"Executing: adb {' '.join(args)}")
            res = self.run_command(["adb"] + args)
            self.root.after(0, self.progress.stop)
            
            if res and res.returncode == 0:
                # This line forces the actual output (like battery stats) into the terminal!
                if res.stdout.strip(): 
                    self.safe_log(res.stdout.strip())
                self.safe_log(success_msg)
            else: 
                self.safe_log(f"Failed: {res.stderr.strip() if res else 'Error'}")
        threading.Thread(target=task, daemon=True).start()

    # FIXED: Added res.stdout printing here as well
    def run_fastboot_background(self, args, success_msg="Command Success"):
        def task():
            self.root.after(0, self.progress.start, 10)
            self.safe_log(f"Executing: fastboot {' '.join(args)}")
            res = self.run_command(["fastboot"] + args)
            self.root.after(0, self.progress.stop)
            
            if res and res.returncode == 0:
                if res.stdout.strip():
                    self.safe_log(res.stdout.strip())
                self.safe_log(success_msg)
            else: 
                self.safe_log(f"Failed: {res.stderr.strip() if res else 'Error'}")
        threading.Thread(target=task, daemon=True).start()

    def update_status_loop(self):
        res = self.run_command(["adb", "devices"])
        if res and hasattr(self, 'status_lbl') and self.status_lbl.winfo_exists():
            devices = [l for l in res.stdout.strip().split('\n')[1:] if l.strip()]
            if devices: 
                color = "#7FBA00" if hasattr(self, 'clr_tile_green') else "blue"
                self.status_lbl.config(text=f"CONNECTED: {devices[0].split()[0]}", fg=color)
            else: 
                color = "#E51400" if hasattr(self, 'clr_tile_red') else "red"
                self.status_lbl.config(text="DISCONNECTED", fg=color)
        self.root.after(3000, self.update_status_loop)

