if __name__ == "__main__":
    root = tk.Tk()
    
    is_xp = False
    if os.name == 'nt' and hasattr(sys, 'getwindowsversion'):
        if sys.getwindowsversion().major == 5:
            is_xp = True
            
    if is_xp:
        app = AeroBridgeXP(root)
    else:
        app = AeroBridgeMetro(root)
        
    root.mainloop()